const { styled } = require("styled-components");

const Form = styled.form`
  display: flex;
  flex-direction: column;
  height: 100vh;
`;

const Label = styled.label`
  display: flex;
  flex-direction: column;
`;

const Input = styled.input`
  width: 50px;
`;

export { Form, Label };
